import React from 'react'

const Dome = (props: any) => {
  return (
    <defs>
      <clipPath clipPathUnits="objectBoundingBox" id={props.type}>
        <rect x="0" y="0" width="100" height="50"/>
      </clipPath>
    </defs>
  )
}

export default Dome;
